postcontent:
This Remington 700 AAC-SD is in excellent condition & is decked out & ready to shoot.   This gun has the 20" heavy, threaded barrel with 1 in 10" twist that Remington calls their "tactical rifling".

Upgrades/additions include:
Timney adjustable trigger (added 5/18/14);
Bennie Cooley muzzle brake (competition legal);
Bell & Carlson free float aluminum bedded stock;
Harris bench rest bipod with detents;
Rubber grip sling;
Weaver one-piece base;
Weaver 6-screw tactical rings;
Millett 4-16 X 50 side focus scope with illuminated BDC reticle, tactical knobs, and sun shade w/ cover (30mm body);
Extended tactical, aluminum bolt knob;
Padded cheek rest with bag and ammo holder;
LimbSaver recoil pad.  

Well over $1,000 in improvements to an already great gun for just $1,400.  And since it has a Timney Trigger installed, you don't have to worry about the recall.  BTW, these triggers are hard to find right now for just that reason.  I will include the factory X-Mark Pro trigger with the gun if you'd like.

Face to face transaction only.  I'd prefer just to sell, but if you have a trade offer, make sure you give me the details of your offer when you contact me.  Thanks.
